feature: 多对多多态关联
一个 video 可以有多个 tag ，一个 post 也可以有多个 tag 。 一个 tag 可以同时属于多个 video 和 多个 post
INSERT INTO `notify`.`videos`(`id`, `title`, `url`, `created_at`, `updated_at`) VALUES (1, 'video1', NULL, NULL, NULL);
INSERT INTO `notify`.`videos`(`id`, `title`, `url`, `created_at`, `updated_at`) VALUES (2, 'video2', NULL, NULL, NULL);
INSERT INTO `notify`.`posts`(`id`, `name`, `title`, `body`, `created_at`, `updated_at`) VALUES (1, 'post1', NULL, NULL, NULL, NULL);
INSERT INTO `notify`.`posts`(`id`, `name`, `title`, `body`, `created_at`, `updated_at`) VALUES (2, 'post2', NULL, NULL, NULL, NULL);
INSERT INTO `notify`.`tags`(`id`, `name`, `created_at`, `updated_at`) VALUES (1, 'tag1', NULL, NULL);
INSERT INTO `notify`.`tags`(`id`, `name`, `created_at`, `updated_at`) VALUES (2, 'tag2', NULL, NULL);INSERT INTO `notify`.`taggables`(`id`, `tag_id`, `taggable_id`, `taggable_type`, `created_at`, `updated_at`) VALUES (1, 1, 1, 'App\\Models\\Post', NULL, NULL);INSERT INTO `notify`.`taggables`(`id`, `tag_id`, `taggable_id`, `taggable_type`, `created_at`, `updated_at`) VALUES (2, 2, 1, 'App\\Models\\Post', NULL, NULL);
INSERT INTO `notify`.`taggables`(`id`, `tag_id`, `taggable_id`, `taggable_type`, `created_at`, `updated_at`) VALUES (3, 1, 2, 'App\\Models\\Post', NULL, NULL);
INSERT INTO `notify`.`taggables`(`id`, `tag_id`, `taggable_id`, `taggable_type`, `created_at`, `updated_at`) VALUES (4, 1, 1, 'App\\Models\\Video', NULL, NULL);
INSERT INTO `notify`.`taggables`(`id`, `tag_id`, `taggable_id`, `taggable_type`, `created_at`, `updated_at`) VALUES (5, 1, 2, 'App\\Models\\Post', NULL, NULL);

SELECT
	`tags`.*,
	`taggables`.`taggable_id` AS `pivot_taggable_id`,
	`taggables`.`tag_id` AS `pivot_tag_id`,
	`taggables`.`taggable_type` AS `pivot_taggable_type` 
FROM
	`tags`
	INNER JOIN `taggables` ON `tags`.`id` = `taggables`.`tag_id` 
WHERE
	`taggables`.`taggable_id` = "1" 
	AND `taggables`.`taggable_type` = "App\\Models\\Post";

